import {React, useState} from 'react'
import Course from '../../component/Courses/Course'
import Fcourse from '../../component/Featured Courses/Fcourse'
import Nav from '../../component/Navbar/Nav'
import Search from '../../component/Searchbar/Search'

const tab = [
  { id: 0, label: "Home" },
  { id: 1, label: "Inprogress" },
];
const Dashboard = () => {
  const [activeTab, setActiveTab] = useState(0);
  return (
    <div>
      <Nav/>
      <div>
      <div className="dashboard">
        <div className="dashboard-tab">
          {tabs.map((tab) => (
            <button
              key={tab.id}
              className={activeTab === tab.id ? "active" : ""}
              onClick={() => setActiveTab(tab.id)}
            >
              {tab.label}
            </button>
          ))}
        </div>
        <div className="dashboard-content">
          {activeTab === 0 && <p>Strengthen <br/>Your Learning <br/><span>With Schoolbook</span></p>}
          {activeTab === 1 && <p>Strengthen <br/>Your Learning <br/><span>With Schoolbook</span></p>}
        </div>
      </div>





        <h2>Your Courses</h2>
        <Course/>
        <div>
          <div>
          <h2>Featured Courses</h2>
          <Search/>
          </div>
          <div>
            <Fcourse/>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Dashboard
